import { useState } from 'react'
import { useNavigate } from 'react-router-dom';

function Signup() {
 const navigate = useNavigate();
 const [name, setName] = useState('');
 const [email, setEmail] = useState('');
 const [password, setPassword] = useState('');
 const [phone, setPhone] = useState('');
 const [gender, setGender] = useState('');
 const [heardFrom, setHeardFrom] = useState([]);
 const [city, setCity] = useState('');
 const [state, setState] = useState('');

 async function registerUser(event) {
     event.preventDefault();

     const response = await fetch('http://localhost:5000/api/register', {
         method: 'POST',
         headers: {
             'Content-Type': 'application/json',
         },
         body: JSON.stringify({
             name,
             email,
             password,
             phone,
             gender,
             heardFrom,
             city,
             state,
         }),
     });

     const data = await response.json();

     if (data.message === 'Data received') {
         navigate('/login');
     }
 }

 return (
     <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100">
         <h1 className="mb-4 text-4xl font-bold">Register</h1>
         <form onSubmit={registerUser} className="w-full max-w-md">
             {/* ...existing input fields... */}
             <div className="flex mb-4">
                <div className="w-1/2 pr-2">
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="name">
                     Name
                  </label>
                  <input
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                    type="text"
                    placeholder="Name"
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  />
                </div>
                <div className="w-1/2 pl-2">
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="email">
                     Email
                  </label>
                  <input
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    type="email"
                    placeholder="Email"
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  />
                </div>
             </div>
             <div className="flex mb-4">
                <div className="w-1/2 pr-2">
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="password">
                     Password
                  </label>
                  <input
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                    type="password"
                    placeholder="Password"
                    className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline"
                  />
                </div>
                <div className="w-1/2 pl-2">
                  <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="heardFrom">
                     How did you hear about this?
                  </label>
                  <div>
                     <input
                        id="linkedin"
                        type="checkbox"
                        checked={heardFrom.includes('linkedin')}
                        onChange={(e) => setHeardFrom(prev => e.target.checked ? [...prev, 'linkedin'] : prev.filter(item => item !== 'linkedin'))}
                     />
                     <label htmlFor="linkedin">LinkedIn</label>
                  </div>
                  <div>
                     <input
                        id="friends"
                        type="checkbox"
                        checked={heardFrom.includes('friends')}
                        onChange={(e) => setHeardFrom(prev => e.target.checked ? [...prev, 'friends'] : prev.filter(item => item !== 'friends'))}
                     />
                     <label htmlFor="friends">Friends</label>
                  </div>
                  <div>
                     <input
                        id="jobPortal"
                        type="checkbox"
                        checked={heardFrom.includes('jobPortal')}
                        onChange={(e) => setHeardFrom(prev => e.target.checked ? [...prev, 'jobPortal'] : prev.filter(item => item !== 'jobPortal'))}
                     />
                     <label htmlFor="jobPortal">Job Portal</label>
                  </div>
                  <div>
                     <input
                        id="others"
                        type="checkbox"
                        checked={heardFrom.includes('others')}
                        onChange={(e) => setHeardFrom(prev => e.target.checked ? [...prev, 'others'] : prev.filter(item => item !== 'others'))}
                     />
                     <label htmlFor="others">Others</label>
                  </div>
                </div>
             </div>
             {/* ...rest of your code... */}
         </form>
     </div>
 );
}

export default Signup;
